#include<iostream>
using namespace std;

long long f(int n, int mod, vector<int> &dp){
    if(n==0 or n==1 or n==2 or n==3) return n;
    if(dp[n] != -1) return dp[n];

    long long p = f(n-1, mod, dp);
    long long q = f(n-2, mod,dp);
    long long r = f(n-3, mod,dp);
    long long s = f(n-4, mod,dp);

    return dp[n] = (p+q+r+s)%mod;


}
int main(){
    int n;
    cin>>n;
    vector<int> dp(n+1, -1);
    cout<<f(n, 1e9 + 7, dp);

    return 0;
}
